import React,{useState,useEffect} from 'react';


export default function InvestorCard({imageURL,href,alt}){

  //custom styling 
  const style={
    card:{
        maxWidth:"350px",
        border:'none'
    }
  }


    return(
        <div className="col-xs-6 col-sm-6 col-md-6 col-lg-6 d-flex  justify-content-center align-items-center">

        <div style={style.card} className='card bg-white w-100 pt-2 pb-2 pl-4 pr-4'>

        <a href={href}>
            <img 
              src={imageURL} 
              className="card-img-top"
              alt={alt}
            />
        </a>

        </div>
      </div>
    )
}
